function Menu() {
    return (
        <div>
            What's the game
            <div>
            <Link to="/Home">ACCEUIL</Link>
            </div>
            <div>
            <Link to="/Actualites">ACTUALITES</Link>
            </div>
            <div>
            <Link to="/Stats">Home</Link>
            </div>
            <div>
            <Link to="/Stats">Home</Link>
            </div>
        </div>
        );
}
export default Menu;
